import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function Home() {
	return (
		<>
			{/* <HeroSection /> */}
			<section>
				<video class="vide" src="image\final.mp4" autoplay loop muted style="width:100%;height:100%"></video>

				<div class="container">
					<h1>the hillcrest</h1>
				</div>
			</section>
			<Cards />
			<Footer />
		</>
	);
}

export default Home;
